import axios from "axios"
import React, { useEffect, useState } from "react"
import { useNavigate, useParams } from "react-router-dom"
import Swal from 'sweetalert2'




function Appoinment() {

    const {id} = useParams()

    const navigate = useNavigate()

    const [storedValue, setStoredValue] = useState("");

   let  [onelaw , setonelaw] = useState([])

   const [lawyers, setlawyers] = useState([])

   const details =  async () => {

    await axios
    .get(`http://localhost:7000/lawyerverf?_id=${id}`)
    .then((res)=> {
        console.log(res.data)
        setonelaw(res.data)

    })
    .catch((err) => {
        console.log(`${err}`)
    })

    await axios
    .get("http://localhost:7000/getlawerd")
    .then((res) => {
        setlawyers(res.data);
        console.log(res.data)
    })
    .catch((err) => {
            console.error(err);
        })

        const value = localStorage.getItem("storedValue");

        if (value) {
            setStoredValue(value);
        }
        if(!value){
            alert("value not come")
        }



         setonelaw(prevState => ({
          ...prevState,
         uniqueuserId: value
        }));




    }


    console.log("local",storedValue)






   const Ratings = ({ num }) => {
    const stars = [];

    for (let i = 0; i < num; i++) {
      stars.push(
        <span key={i}>
          <box-icon name='star' type='solid' animation='tada' color='#ffec00' ></box-icon>
        </span>
      );
    }
    console.log(stars)
    return <div>{stars}</div>;
  };

    console.log("check",onelaw)




    const following = async () => {




        await axios
        .post("http://localhost:7000/followpoint", onelaw)
        .then((res)=>{
          console.log(res.data)
          if(res.data){
            Swal.fire({
              position: "top-end",
              icon: "success",
              title: "Following",
              showConfirmButton: false,
              timer: 1500,
            });
            navigate(`/userenter/${storedValue}`)
          }
        })
        .catch((err)=>{
          console.log(`${err}`)
        })



    }




   const val = async () => {
    const { value: date } = await Swal.fire({
      title: "select departure date",
      input: "date",
      didOpen: () => {
        const today = (new Date()).toISOString();
        Swal.getInput().min = today.split("T")[0];
      }
    });
    if (date) {
      Swal.fire("Departure date", date);
    }
    console.log({value:date})
   }








   useEffect(() => {
    details()

   },[])

    return (

        <div className="over-view-main">
            <div className="rect">
            <div className="circle2">
                <img src={`http://localhost:7000/static/${onelaw.originalname}`} style={{ maxWidth: '290px', maxHeight: '250px'  }}/>


            </div>

            <div className="content-q">
                <div className="d-v">
                    <p className="name2">{onelaw.name}</p>
                    <p>Age :{onelaw.age}</p>
                    <p>Location :{onelaw.location}</p>
                    <p>Carrier Started:{onelaw.csYear}</p>
                    <p>No of SuccessCase:{onelaw.successcase}</p>
                    <p><Ratings num={onelaw.ratings} /></p>

                </div>

                <div class="card40">
  <div class="stats-wrapper">
    <p class="heading">Rating</p>
    <div class="bottom-wrapper">
      <svg viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" class="star">
        <g data-name="Layer 2">
          <g data-name="star">
            <rect
              opacity="0"
              transform="rotate(90 12 12)"
              height="24"
              width="24"
